import React from 'react';

//---images----//
import logo from '../assets/homepage/radio header/menu.svg'

export default class home extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            name: "home"
            , myApp: this.props.myParent
            , myParent: this.props.myParent
            , hidden: this.props.hidden
        }

        this.state.myParent.setState((x) => {
            x.myChildrens.push(this);
        });

    }
    componentWillMount() {

    }

    render() {
        const fthis = this;
        let hidden = this.state.hidden ? "hiddenPage"
            : "showPage scrollPage";
        return (
            <div className={hidden}>
                <div className="radio-header">
                    <div className="logo">
                    <image atr="" src={logo} />
                    </div>
                </div>
            </div>
        )
    }

}
